script: |
  super -f text -I q3866.spq | sort > q3866.out

inputs:
  - name: q3866.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NOT - col0 BETWEEN - col2 + 71 AND + col2 / + + col0 / - ( col0 ) + + + 46 + + col1 - col0 + - col2 * col0 / - 8;
  - name: tab0

outputs:
  - name: q3866.out
    data: |
      15	81	47
      87	21	10
      97	1	99
